var NOTE = '#nn-notification';

$().ready(function () {

//   $('body').append($('<div/>', {
//      id: 'nn-notification',
//      style: {display: 'none'}
//   }));
});


function _showNote(msg, type) {

   var btnType = (type === 'info') ? 'info' : 'light';

   var str = "";
   str += "<div class='text-panel " + type + "'>";
   str += "<p class='m-0 p-0'>" + msg + "</p>";

   str += "<hr class='mx-0 my-2 mt-3'>";
   str += "<div class='text-right'>";
   str += "<button onclick='hideNote()' class='btn btn-sm btn-" + btnType + "' style='width:100px'>Close</button>";
   str += "</div>";

   str += "<div class='clearfix'></div>";
   str += "</div>";

   $(NOTE).hide(1, function () {
      $(NOTE).html(str).fadeIn('fast');
      //beep();
   });
}

function iNote(msg) {
   _showNote(msg, 'info');
}

function eNote(msg) {
   _showNote(msg, 'error');
   beep();
}

function iConfirm(msg) {

}

function hideNote() {
   $(NOTE).fadeOut(100, function () {
      $(NOTE).html("");
   });
}


function beep() {
   var snd = new Audio("data:audio/wav;base64,");
   snd.play();
}
